import React , {useState} from "react"
let Days = (props) => {
    let [day , setday] = useState(props.day)
    let clickhandler = () => {setday("blank")}
    return (<div>
    <div>{day}</div>
    <div>{props.weather}</div>
    <button onClick={clickhandler}>UpdateDay</button>
    </div>)
}

export default Days
